  <div className='cv__resume'>
    <Square className='cv__resume' height={18} width={18} color={{ r: 133, g: 29, b: 252 }} />
    <h1>Resume</h1>
    <div className='cv__resume'>
      <h2>Skills & Education</h2>
      <Button name='DOWNLOAD CV'/>
    </div>
    <div>

    </div>
  </div>
);

export default Resume;
